import base64
from io import BytesIO
from PIL import Image

# Cadena Base64 (ejemplo acortado, reemplaza por tu cadena completa)
base64_string = """
/9j/4AAQSkZJRgABAQAAAQABAAD/2wBDAAIBAQEBAQIBAQECAgICAgQDAgICAgUEBAMEBgUGBgYFBgYGBwkIBgcJBwYGCAsICQoKCgoKBggLDAsKDAkKCgr/2wBDAQICAgICAgUD
... (continúa tu base64 aquí)
"""

# Decodificar la cadena Base64
image_data = base64.b64decode(base64_string)

# Crear una imagen desde los bytes
image = Image.open(BytesIO(image_data))

# Mostrar la imagen
image.show()


